import React from 'react';
import { NavLink } from 'react-router-dom';

const Sidebar = () => {
    return (
        <aside
            className="bg-gray-200 p-4"
            style={{
                width: '208px', // Fixed width
                height: '88px', // Fixed height
                marginTop: '109px', // Top margin
                marginLeft: '24px', // Left margin
            }}
        >
            <nav>
                <ul className="space-y-2"> {/* Adds gap between list items */}
                    <li>
                        <NavLink
                            to="/"
                            className={({ isActive }) =>
                                `block py-2 px-4 ${isActive ? 'bg-blue-500 text-white' : 'hover:bg-gray-300'
                                }`
                            }
                        >
                            Overview
                        </NavLink>
                    </li>
                    <li>
                        <NavLink
                            to="/page1"
                            className={({ isActive }) =>
                                `block py-2 px-4 ${isActive ? 'bg-blue-500 text-white' : 'hover:bg-gray-300'
                                }`
                            }
                        >
                            People Directory
                        </NavLink>
                    </li>
                </ul>
            </nav>
        </aside>
    );
};

export default Sidebar;
